const TableRow = ({ appInstanceName, appName, description, isFirstGear }) => {

  const [showForm, setShowForm] = useState(false);
  const [formData, setFormData] = useState({});
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  const handlePlayButtonClick = async (appName) => {
      try {
          const response = await fetch(`http://127.0.0.1:5000/apps/${appName}/run`, {
              method: 'POST',
              headers: {
                  'Content-Type': 'application/json',
              },
          });
          if (response.ok) {
              console.log('Play button clicked successfully');
              // Handle successful response if needed
          } else {
              console.error('Failed to handle play button click:', response.statusText);
          }
      } catch (error) {
          console.error('Error handling play button click:', error);
      }
  };

  const handleGearClick = () => {
      setShowForm(true);
  };

  const handleCloseForm = () => {
      setShowForm(false);
  };

  const handleSubmit = async (e) => {
      e.preventDefault();
      // Submit form data to backend
      try {
          const response = await fetch(`http://127.0.0.1:5000/apps/${appName}/saveconfig`, {
              method: 'POST',
              headers: {
                  'Content-Type': 'application/json',
              },
              body: JSON.stringify(formData),
          });
          if (response.ok) {
              console.log('Form data submitted successfully');
              setFormData({});
              setShowForm(false); // Close the form after successful submission
              // Redirect to the main page
              window.location.href = '/'; // This will reload the main page
          } else {
              console.error('Failed to submit form data:', response.statusText);
          }
      } catch (error) {
          console.error('Error submitting form data:', error);
      }
  };

  const handleChange = (e) => {
      const { name, value } = e.target;
      setFormData(prevData => ({
          ...prevData,
          [name]: value,
      }));
  };

  return (
      <tr>
          <td>
              <Link to="/form" state={{appName:appName}}>
                  <div className="app">
                      <svg
                          xmlns="http://www.w3.org/2000/svg"
                          width="40"
                          height="40"
                          viewBox="0 0 24 24"
                          fill="none"
                          stroke="currentColor"
                          strokeWidth="2"
                          strokeLinecap="round"
                          strokeLinejoin="round"
                          className="lucide lucide-layout-grid"
                      >
                          <rect width="7" height="7" x="3" y="3" rx="1" />
                          <rect width="7" height="7" x="14" y="3" rx="1" />
                          <rect width="7" height="7" x="14" y="14" rx="1" />
                          <rect width="7" height="7" x="3" y="14" rx="1" />
                      </svg>
                      <p>{appInstanceName}</p>
                  </div>
              </Link>
          </td>
          <td>{appName}</td>
          <td>{description}</td>
          <td>
              <Link to="/form" state={{appName:appName}}>
                  <svg
                      xmlns="http://www.w3.org/2000/svg"
                      width="40"
                      height="40"
                      viewBox="0 0 24 24"
                      fill="none"
                      stroke="currentColor"
                      strokeWidth="2"
                      strokeLinecap="round"
                      strokeLinejoin="round"
                      className="lucide lucide-settings"
                      onClick={handleGearClick}
                  >
                      <path d="M12.22 2h-.44a2 2 0 0 0-2 2v.18a2 2 0 0 1-1 1.73l-.43.25a2 2 0 0 1-2 0l-.15-.08a2 2 0 0 0-2.73.73l-.22.38a2 2 0 0 0 .73 2.73l.15.1a2 2 0 0 1 1 1.72v.51a2 2 0 0 1-1 1.74l-.15.09a2 2 0 0 0-.73 2.73l.22.38a2 2 0 0 0 2.73.73l.15-.08a2 2 0 0 1 2 0l.43.25a2 2 0 0 1 1 1.73V20a2 2 0 0 0 2 2h.44a2 2 0 0 0 2-2v-.18a2 2 0 0 1 1-1.73l.43-.25a2 2 0 0 1 2 0l.15.08a2 2 0 0 0 2.73-.73l.22-.39a2 2 0 0 0-.73-2.73l-.15-.08a2 2 0 0 1-1-1.74v-.5a2 2 0 0 1 1-1.74l.15-.09a2 2 0 0 0 .73-2.73l-.22-.38a2 2 0 0 0-2.73-.73l-.15.08a2 2 0 0 1-2 0l-.43-.25a2 2 0 0 1-1-1.73V4a2 2 0 0 0-2-2z" />
                      <circle cx="12" cy="12" r="3" />
                  </svg>
              </Link>
          </td>
          <td>
              {isFirstGear && (
                  <svg
                      style={{cursor:'pointer'}}
                      onClick={handlePlayButtonClick}
                      xmlns="http://www.w3.org/2000/svg"
                      width="40"
                      height="40"
                      viewBox="0 0 24 24"
                      fill="none"
                      stroke="currentColor"
                      strokeWidth="2"
                      strokeLinecap="round"
                      strokeLinejoin="round"
                      className="lucide lucide-play"
                  >
                      <polygon points="5 3 19 12 5 21 5 3" />
                  </svg>
              )}
          </td>
          {showForm && (
              <Form appName={appName} setShowForm={setShowForm} />
          )}
      </tr>
  );
};
